import React from "react";

function SearchBar() {
  return (
    <div className="input-group flex-nowrap">
      <span className="input-group-text" id="addon-wrapping">
        search
      </span>
      <input
        type="text"
        class="form-control"
        placeholder="search input"
        aria-label="Username"
        aria-describedby="addon-wrapping"
      />
    </div>
  );
}
export default SearchBar;
